// Get all data from different sources
const allInputs = $input.all();
const calendarEvents = allInputs.find(b => b.json.calendarEvents)?.json.calendarEvents || [];
const emails = allInputs.find(b => b.json.emails)?.json.emails || [];
const commits = allInputs.find(b => b.json.commits)?.json.commits || [];
const prs = allInputs.find(b => b.json.prs)?.json.prs || [];

// Format calendar events
const confirmed = calendarEvents.filter(e => e.status === 'confirmed');

const calendarSummary = confirmed.map(event => ({
  time: event.start?.dateTime || 'No time',
  title: event.summary || 'No title',
  attendees: event.attendees?.length || 0,
  description: event.description || 'No description',
  duration: DateTime.fromISO(event.end.dateTime).diff(DateTime.fromISO(event.start.dateTime), 'hours').hours
}));

// Format emails (filter out unimportant ones)
const importantEmails = emails
  .filter(email => 
    email.From && 
    !email.From.toLowerCase().includes('noreply') && 
    !email.Subject?.toLowerCase().includes('newsletter')
  )
  .slice(0, 20)
  .map(email => ({
    from: email.From,
    subject: email.Subject || 'No subject',
    snippet: email.snippet?.substring(0, 100) || ''
  }));

const commitArray = Array.isArray(commits) ? commits : [commits];
const prsArray = Array.isArray(prs) ? prs : [prs];
// Format GitHub activity
const githubActivity = {
  commits: commitArray.map(commit => ({
    message: commit.commit?.message || 'No message'
  })) || [],
  pullRequests: prsArray.map(pr => ({
    title: pr.title,
    repo: pr.head.repo?.name || 'Unknown repo',
    state: pr.state
  })) || []
};

// Create summary object
const summary = {
  date: $('Set Variables').first().json.today,
  calendar: {
    totalEvents: calendarSummary.length,
    events: calendarSummary
  },
  emails: {
    totalReceived: emails.length,
    important: importantEmails
  },
  github: githubActivity
};

return [{ json: summary }];
